export default function WeatherTemperature(props) {
  return (
    <div>
      <strong id="temperature">{Math.round(props.info.temperature)}</strong>
      <span className="units">
        <a href="#" id="celsius-link" className="active">
          ºC{" "}
        </a>
        |
        <a href="#" id="fahrenheit-link">
          ºF
        </a>
      </span>
    </div>
  );
}
